var MS5803 = require('./index.js');

var sensor = new MS5803({address: 0x76, device: '/dev/i2c-1'});

var temp;
var mbar;

sensor.read(function (err, data) {
   temp = data.temperature;
   mbar = data.pressure;
//  console.log(data);
  console.log("Temp : "+temp );
  console.log("Mbar : "+ mbar);
});
